import STable from '@/components/table/';
import ATextarea from "ant-design-vue/es/input/TextArea";
import AInput from "ant-design-vue/es/input/Input";
import moment from "moment";
import axios from 'axios';
import { getRoleList, getServiceList } from '@/api/manage';
export default {
  name: "TableList",
  components: {
    AInput: AInput,
    ATextarea: ATextarea,
    STable: STable
  },
  data: function data() {
    var _this = this;

    return {
      visibleCreateModal: false,
      visible: false,
      labelCol: {
        xs: {
          span: 24
        },
        sm: {
          span: 5
        }
      },
      wrapperCol: {
        xs: {
          span: 24
        },
        sm: {
          span: 12
        }
      },
      form: null,
      mdl: {},
      // 高级搜索 展开/关闭
      advanced: true,
      // 查询参数
      queryParam: {},
      // 表头
      columns: [{
        title: '规则编号',
        dataIndex: 'no'
      }, {
        title: '描述',
        dataIndex: 'description'
      }, {
        title: '服务调用次数',
        dataIndex: 'callNo',
        sorter: true,
        needTotal: true,
        customRender: function customRender(text) {
          return text + ' 次';
        }
      }, {
        title: '状态',
        dataIndex: 'status',
        needTotal: true
      }, {
        title: '更新时间',
        dataIndex: 'updatedAt',
        sorter: true
      }, {
        table: '操作',
        dataIndex: 'action',
        width: '150px',
        scopedSlots: {
          customRender: 'action'
        }
      }],
      // 加载数据方法 必须为 Promise 对象
      loadData: function loadData(parameter) {
        return getServiceList(Object.assign(parameter, _this.queryParam)).then(function (res) {
          return res.result;
        });
      },
      selectedRowKeys: [],
      selectedRows: []
    };
  },
  created: function created() {
    getRoleList({
      t: new Date()
    });
  },
  methods: {
    handleEdit: function handleEdit(record) {
      this.mdl = Object.assign({}, record);
      console.log(this.mdl);
      this.visible = true;
    },
    handleOk: function handleOk() {},
    //添加逻辑
    handleModalVisible: function handleModalVisible(isVisible) {
      this.visibleCreateModal = isVisible;
    },
    handleCreateModalOk: function handleCreateModalOk() {
      var _this2 = this;

      this.createForm.validateFields(function (err, fieldsValue) {
        if (err) {
          return;
        }

        var description = _this2.createForm.getFieldValue('description');

        axios.post('/saveRule', {
          desc: description
        }).then(function (res) {
          _this2.createForm.resetFields();

          _this2.visibleCreateModal = false;

          _this2.loadRuleData();
        });
      });
    },
    handleCreateModalCancel: function handleCreateModalCancel() {
      this.visibleCreateModal = false;
    },
    onChange: function onChange(row) {
      this.selectedRowKeys = row.selectedRowKeys;
      this.selectedRows = row.selectedRows;
      console.log(this.$refs.table);
    },
    toggleAdvanced: function toggleAdvanced() {
      this.advanced = !this.advanced;
    },
    resetSearchForm: function resetSearchForm() {
      this.queryParam = {
        date: moment(new Date())
      };
    }
  },
  watch: {
    /*
    'selectedRows': function (selectedRows) {
      this.needTotalList = this.needTotalList.map(item => {
        return {
          ...item,
          total: selectedRows.reduce( (sum, val) => {
            return sum + val[item.dataIndex]
          }, 0)
        }
      })
    }
    */
  }
};
